(13, 1, 'fabaceae', 'Fabaceae', 'Бобо́вые, или Мотыльковые (лат. Fabáceae, или Leguminósae, или Papilionaceae), — семейство двудольных растений порядка Бобовоцветные.', '2021-03-08 13:54:46', '2021-03-08 13:54:46', NULL),
(14, 0, 'brassicaceae', 'Brassicaceae', 'Капу́стные, или Капу́стовые[2], или Бра́ссиковые[2] (лат. Brassicáceae), также Крестоцве́тные (Crucíferae) — семейство двудольных растений отдела Покрытосеменные (Цветковые), включающее в себя однолетние и многолетние травы, изредка полукустарники или кустарники.\r\n\r\nОбъём семейства — 372 рода и более 4 тысяч видов[3]. Отличительной особенностью семейства является обилие двулетних монокарпичных (то есть цветущих лишь на последнем году жизни) трав.\r\n\r\nКапуста является важнейшим для человека представителем этого семейства.', '2021-03-08 14:01:57', '2021-03-08 14:01:57', NULL),
(15, 1, 'asteraceae', 'Asteraceae', 'А́стровые (лат. Asteráceae), или Сложноцве́тные (лат. Compósitae) — одно из самых больших семейств двудольных растений; включает 32 913 видов, объединённых в 1911 родов[3], распространённых по всему земному шару и представленных во всех климатических зонах.', '2021-03-08 14:02:17', '2021-03-08 14:02:17', NULL);
